import React from "react";
import classes from "./Home.module.scss";
import logoLight from "../../assets/logo-light.svg";
import logoDark from "../../assets/logo-dark.svg";
const Home = () => {
  return (
    <section className={classes.home}>
      {/* header start */}
      <section className={classes.header}>
        <div className={classes.logo}>
          <img src={logoDark} alt="logo_light" />
        </div>
      </section>
      {/* header end */}
      {/* body start */}
      <section className={classes.kanban_app_body}>
        <section className={classes.side_bar}>
          <section className={classes.side_bar_content}>
            <section>
              <span>all boards</span>
              <ul>
                <li><span>Platform Launch</span></li>
                <li><span>Marketing Plan</span></li>
                <li><span>Roadmap</span></li>
                <li><span>Create New Board</span></li>

              </ul>
            </section>
          </section>
        </section>
      </section>
      {/* body end */}
    </section>
  );
};

export default Home;
